import classes from "./Footer.module.css";

function Footer() {
  return (
    <div className={classes.footer}>
      <div className="row justify-content-between">
        <div className="col-md-5 ml-1 p-3">
          <ion-icon
            style={{
              "font-size": "25px",
              "font-weight": "bold",
            }}
            name="logo-xing"
          ></ion-icon>
          Nucleus
        </div>
        <div className="col-md-5 p-3">F I T L Y</div>
      </div>
      <div className="row">
        <div className="col-md-3">About</div>
        <div className="col-md-3">Services</div>
        <div className="col-md-3">Help</div>
        <div className="col-md-3">Mail Us</div>
      </div>
      <div className="row">
        <div className="col-md-6">Â© 2000-2023 Nucleus.com</div>
        <div className="col-md-6">Terms and Conditions</div>
      </div>
    </div>
  );
}

export default Footer;
